VkResult vkLoadLoader(const DynLib* lib, VkInterfaceLoader* out) {
  out->getInstanceProcAddr = dynlib_symbol(lib, string_lit("vkGetInstanceProcAddr"));
  if (!out->getInstanceProcAddr) {
    return VK_ERROR_INITIALIZATION_FAILED;
  }
  out->createInstance = (Symbol)out->getInstanceProcAddr(null, "vkCreateInstance");
  out->enumerateInstanceExtensionProperties = (Symbol)out->getInstanceProcAddr(null, "vkEnumerateInstanceExtensionProperties");
  out->enumerateInstanceLayerProperties = (Symbol)out->getInstanceProcAddr(null, "vkEnumerateInstanceLayerProperties");
  out->enumerateInstanceVersion = (Symbol)out->getInstanceProcAddr(null, "vkEnumerateInstanceVersion");
  return VK_SUCCESS;
}

